import React from 'react';
import { DraggableItem } from "../components/Generals/DraggableItem";
import { ShapeType } from '../contexts/DraggableContext';

type Shape = {
  id: number;
  type: ShapeType;
};

const shapes: Shape[] = [
  { id: 1, type: 'circle' },
  { id: 2, type: 'rectangle' },
  { id: 3, type: 'vector' },
];

const ShapeLibrary: React.FC = () => {
  return (
    <div>
      {shapes.map((shape) => (
        <DraggableItem 
          key={shape.id} 
          id={shape.id} 
          type={shape.type} 
        />
      ))}
    </div>
  );
};

export default ShapeLibrary;
